def cluster_simplify(obstacles, n_clusters):
    if len(obstacles) <= n_clusters:
        return obstacles
    kmeans = KMeans(n_clusters=n_clusters, random_state=0).fit(obstacles)
    return kmeans.cluster_centers_.tolist()


